import React from 'react';

interface IProps{
    required: boolean | undefined,
    value:string,
    maxLenght:number,
    onChange:(event:React.FormEvent<HTMLSelectElement>) => {}
}

function TextInput({value, required, maxLenght , onChange} :IProps) {
  return (
    <input 
        value={value}  
        maxLength={maxLenght}
        required={required}
    />
  )
}

export default TextInput
